import React, { useState } from "react";
import { Questions } from "./api";
import QA from "./Question";


const Interview = () => {
    const [val, setVal] = useState(Questions)
    return (
        <>
            {
                val.map((currElmt) => {
                   const {id} = currElmt;
                   return <QA key={id} {...currElmt}/>

                })
            }
        </>
    )
}

export default Interview;
